package kr.co.alphanewcare.result;import android.content.Intent;import android.os.Bundle;import androidx.appcompat.app.AppCompatActivity;import kr.co.alphanewcare.R;import kr.co.alphanewcare.capture.CaptureActivity;import kr.co.alphanewcare.result.model.ResultData;public class ResultActivity extends AppCompatActivity{    private ResultUISetup uiSetup;    private ResultAction action;    @Override    protected void onCreate(Bundle savedInstanceState)    {        super.onCreate(savedInstanceState);        setContentView(R.layout.activity_result);        init();    }    @Override    protected void onStart()    {        super.onStart();    }    @Override    protected void onResume()    {        super.onResume();    }    @Override    protected void onPause()    {        super.onPause();    }    @Override    protected void onStop()    {        super.onStop();    }    @Override    protected void onDestroy()    {        super.onDestroy();    }    @Override    protected void onRestart()    {        super.onRestart();    }    private void init()    {        Intent intent = getIntent();        ResultData result = intent.getParcelableExtra(CaptureActivity.URS_RESULT);        int paperMode = intent.getIntExtra(CaptureActivity.PAPER_MODE, 1);        uiSetup = new ResultUISetup(this, this, result);        action = new ResultAction(this, this, result, paperMode);        uiSetup.setAction(action);        action.setUiSetup(uiSetup);        uiSetup.setupViews();        uiSetup.setupButtons();    }}